import logo from './Nielsenlogo.jpg';
import React,{useState} from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import './App.css';


class Login extends React.Component {
  constructor(props) {
    super(props);
 
    this.state = {
      name:"George",
      greeting:"Greet"
    };
  }

  handleSubmit(event){
    // alert("hi")
    this.setState({name:"afdsf"})
    // fetch('https://api.mydomain.com')
    // .then(response => response.json())
    // .then(data => this.setState({ name:data}));
    // fetch(`policies?VAULT_TOKEN=`)
    // .then(response => setName(response.json()));
  }
  render(){
    return (
        <div className="App">
          <header className="App-header">
            <img src={logo} className="App-logo" alt="logo" />
            <p style={{color:"black",fontSize:"40px"}}>
              Policy Editor
            </p>
            <p style={{color:"black"}}>{this.state.name}</p>
            <Form onSubmit={() => this.handleSubmit()}>
              <Form.Group controlId="formToken" style={{display:"flex",flexDirection:"row"}}>
                <Form.Label>
                <div style={{overflow:"hidden",whiteSpace:"nowrap",color:"black",marginRight:15}}>
                  Vault Token: 
                </div>
                </Form.Label>
                <Form.Control placeholder="Enter Token" />
              </Form.Group>
              <Button variant="primary" type="submit">
                Submit
              </Button>
            </Form>

          </header>
        </div>
    );
  }
}

export default Login;
